import React, { createContext, useContext, useEffect, useState } from "react";
import { Switch, Route } from "react-router-dom";
import CoachList from "./CoachList";
import NavBar from "./Navbar";
import Home from "./Home";
import Login from "./Login";
import Signup from "./SignUp";
import Logout from "./Logout";
import TeamList from "./TeamList";
import NavbarLogIn from "./NavbarLogIn";
import NewTeam from "./NewTeam";
import NewRoster from "./NewRoster";
import RosterList from "./RosterList";

export const CoachContext = createContext(null);
export const TeamContext = createContext(null);
export const RosterContext = createContext(null);
export const LoginContext = createContext(null);
export const UserContext = createContext(null);


function App() {
    const [coaches, setCoaches] = useState([]);
    const [teams, setTeams] = useState([]);
    const [rosters, setRosters] = useState([]);
    const [login, setLogin] = useState(false);
    const [user, setUser] = useState([]);
    const [error, setError] = useState(false);
    const [increment, setIncrement] = useState(0);


    useEffect(() => {
        fetch('/coaches')
        .then((r) => r.json())
        .then((data) => setCoaches(data));
    }, [CoachList]);

    useEffect(() => {
        fetch('/teams')
        .then((r) => r.json())
        .then((data) => setTeams(data));
    }, [TeamList]);

    useEffect(() => {
        fetch('/rosters')
        .then((r) => r.json())
        .then((data) => setRosters(data));
    }, [increment]);

    useEffect(() => {
        fetch("/currentuser")
        .then((r) => r.json())
        .then((data) => setUser(data));
    }, [increment]);

    function onSignupSubmit(data) {
        setCoaches(...coaches, data)
        setIncrement((increment) => increment + 1)
    };

    function onNewTeam(data) {
        setTeams(...teams, data)
        setIncrement((increment) => increment + 1)
    };

    function onLogin() {
        setLogin((login) => !login)
        setIncrement((increment) => increment + 1)
    };

    function onNewRoster(data) {
        setRosters(...rosters, data)
        setIncrement((increment) => increment + 1)
    };




    return (
        <div>
            {login ? (
                <NavBar/>
            ) : (
                <NavbarLogIn />
            )}
            <Switch>
                <Route exact path="/coaches">
                    <CoachContext.Provider value={coaches}>
                        <CoachList />
                    </CoachContext.Provider>
                </Route>
                <Route exact path="/">
                    <UserContext.Provider value={user}>
                    <LoginContext.Provider value={login}>
                        <Home login={login} setUser={setUser} user={user} />
                    </LoginContext.Provider>
                    </UserContext.Provider>
                </Route>
                <Route exact path="/login">
                    <Login onLogin={onLogin}  />
                </Route>
                <Route exact path="/signup">
                    <Signup setError={setError} error={error} onSignupSubmit={onSignupSubmit} onLogin={onLogin}/>
                </Route>
                <Route exact path="/logout">
                    <Logout onLogin={onLogin} login={login} />
                </Route>
                <Route exact path="/teams">
                    <TeamContext.Provider value={teams}>
                        <TeamList onNewTeam={onNewTeam} login={login} user={user} />
                    </TeamContext.Provider>
                </Route>
                <Route exact path="/newteam">
                    <NewTeam />
                </Route>
                <Route exact path="/newroster">
                    <NewRoster onNewRoster={onNewRoster} user={user} teams={teams}/>
                </Route>
                <Route exact path="/rosters">
                    <RosterList rosters={rosters} user={user} />
                </Route>
            </Switch>
        </div>
    )
}

export default App;
